import React, {Component} from 'react'
import {Link} from 'react-router-dom'

class Navbar extends Component{
    render(){
        let isActiveReg = this.props.location ? "/register" : true
        let activeRegStyle = null;
        if(isActiveReg){
            activeRegStyle = "blue"
        }
        else
            activeRegStyle = "black"
        return(
            <div className="App">
                    <hr/>
                        <h2 style={navTextStyling}>News Products Login <Link style={{textDecoration:"none" }} to="/register">Register</Link></h2>
                    <hr/> 
              
            </div>
        )
    }
}

const navTextStyling = {
    wordSpacing: "100px",
    fontSize: "12px"
}
const linkStyle = {
    textDecoration: "none",
    color: "black"
}

export default Navbar;
